import React, { useState } from "react";
import { Nav, Dropdown, Navbar, Form, FormControl } from "react-bootstrap";
import cookie from "js-cookie";

const Header = props => {
  const currentUser = props.currentUser.data;
  const handleLogOutUser = () => {
    cookie.remove("crumbl");
    window.open("/", "_self");
  };

  // The forwardRef is important!!
  // Dropdown needs access to the DOM node in order to position the Menu
  const CustomToggle = React.forwardRef(({ children, onClick }, ref) => (
    <a
      href=""
      ref={ref}
      onClick={e => {
        e.preventDefault();
        onClick(e);
      }}
    >
      {children}
      &#x25bc;
    </a>
  ));

  // forwardRef again here!
  // Dropdown needs access to the DOM of the Menu to measure it
  const CustomMenu = React.forwardRef(
    ({ children, style, className, "aria-labelledby": labeledBy }, ref) => {
      const [value, setValue] = useState("");

      return (
        <div
          ref={ref}
          style={style}
          className={className}
          aria-labelledby={labeledBy}
        >
          <FormControl
            autoFocus
            className="mx-3 my-2 w-auto"
            placeholder="Type to filter..."
            onChange={e => setValue(e.target.value)}
            value={value}
          />
          <ul className="list-unstyled">
            {React.Children.toArray(children).filter(
              child =>
                !value || child.props.children.toLowerCase().startsWith(value)
            )}
          </ul>
        </div>
      );
    }
  );

  return (
    <div>
      <Navbar
        bg="light"
        variant="light"
        collapseOnSelect
        expand="lg"
        fixed="top"
      >
        <a className="navbar-brand" href="/">
          <img
            src="https://res.cloudinary.com/justin-bresee/image/upload/v1580358986/Internskip/internskip_logo_x2n2pm.png"
            width="200"
            alt=""
          />
        </a>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link
              id="login-button"
              href="/login"
              className="bg-light text-primary rounded px-3 mr-3"
              style={{
                display: cookie.get("crumbl") ? "none" : ""
              }}
            >
              Login
            </Nav.Link>
            <Nav.Link
              id="register-button"
              href="/register"
              className="bg-light text-primary rounded px-3 mr-3"
              style={{
                display: cookie.get("crumbl") ? "none" : ""
              }}
            >
              Sign Up
            </Nav.Link>
            <Nav.Link
              id="register-button"
              href="/create-project"
              className="bg-primary text-white rounded mx-2 px-2"
              style={{
                display: cookie.get("crumbl") ? "none" : ""
              }}
            >
              Post a Project
            </Nav.Link>
          </Nav>
          <Dropdown
            drop="left"
            style={{ visibility: props.auth ? "visible" : "hidden" }}
          >
            <Dropdown.Toggle variant="primary" id="dropdown-basic">
              {currentUser.first_name + " " + currentUser.last_name}
            </Dropdown.Toggle>

            <Dropdown.Menu>
              <Dropdown.Item href="#/action-1">Profile</Dropdown.Item>
              <Dropdown.Item href="#/action-1">Portfolio</Dropdown.Item>
              <Dropdown.Item href="#/action-2">Settings</Dropdown.Item>
              <Dropdown.Item onClick={() => handleLogOutUser()}>
                Sign Out
              </Dropdown.Item>
            </Dropdown.Menu>
          </Dropdown>
        </Navbar.Collapse>
      </Navbar>
      <Navbar
        className="bg-dark justify-content-between"
        fixed="top"
        style={{ marginTop: "80px" }}
      >
        <Dropdown>
          <Dropdown.Toggle as={CustomToggle} id="dropdown-custom-components">
            Custom toggle
          </Dropdown.Toggle>

          <Dropdown.Menu as={CustomMenu}>
            <Dropdown.Item eventKey="1">Red</Dropdown.Item>
            <Dropdown.Item eventKey="2">Blue</Dropdown.Item>
            <Dropdown.Item eventKey="3" active>
              Orange
            </Dropdown.Item>
            <Dropdown.Item eventKey="1">Red-Orange</Dropdown.Item>
          </Dropdown.Menu>
        </Dropdown>
      </Navbar>
    </div>
  );
};

export default Header;
